//Botones de usuario para web 
export const ButtonMainUserI = (props) => {
    return <a className="ButtonMainUserI" {...props}></a>
}
export const ButtonMainUserO = (props) => {
    return <a className="ButtonMainUserO" {...props}></a>
}

export const ButtonMainUserOuput = (props) => {
    return <button className="ButtonMainUserI" {...props}></button>
}

//Botones para web movil
export const ButtonMainMovUserI = (props) => {
    return <a className="ButtonMainMovUserI" {...props}></a>
}

export const ButtonMainMovUserO = (props) => {
    return <button className="ButtonMainMovUserO" {...props}></button>
}
